import React from 'react';
import '../css/Logo.css';
import Leftbox from './Leftbox';

const Logo = () => {
    return (
        <>
        <div className='container'>
            <p className='logohead'>Create New</p>
        </div>
        <div className='row'>
           <div className='box'></div>
           <Leftbox/>
           <Leftbox/>
           <Leftbox/>
        </div>
        </>
    );
};

export default Logo;
